<template>
  <div>
    <br/>
    <input type="file" id="file" @change="selectFile" accept="*" multiple ref="file" src=""/>
    <br/><br/>
    <video id="video" controls   ref="video"/>
    <br/>
    <img src="data:image/jpeg;base64,"  ref="fileImg" height="200" width="200"/>
    <br/>
    <div style="word-wrap:break-word ;" id="result" name="result" ref="result"></div>
  </div>
</template>

<script>
    export default {
        name: "NativeFile",
        methods:{
            selectFile(){
              var file = this.$refs.file.files[0];
              let reader = new FileReader();
              reader.readAsDataURL(file);// 图片文件转换为base64
                reader.onloadend = e => {
                  this.$set(this.$refs.video, "src", e.target.result);
                  this.$refs.result.innerHTML=e.target.result
                  console.log(e.target.result);
              }
            }
          }
    }
</script>

